package tesseractexample;

import java.awt.image.BufferedImage;
import java.io.BufferedOutputStream;
import java.io.File;
import java.io.FileOutputStream;
import java.io.IOException;
import java.io.OutputStream;
import javax.imageio.ImageIO;
import net.sourceforge.tess4j.*;
import net.sourceforge.tess4j.util.*;
/**
 *
 * @author master
 */
public class OcrByParameter {
    /**
     * @param args the command line arguments
     */
    public static void main(String[] args) throws IOException {
        //String base64 = "";
        String base64 = "";
        ITesseract instance = new Tesseract();  // JNA Interface Mapping
        instance.setDatapath("C:/proyecto/TesseractExample_2.1/tessdata"); // path to tessdata directory
        
        /* guardar el base64*/
            byte[] imageBytes = javax.xml.bind.DatatypeConverter.parseBase64Binary(base64);
            String path = "C:\\grupogd\\test_image.png";
            File file = new File(path);
            try (OutputStream outputStream = new BufferedOutputStream(new FileOutputStream(file))) {
                outputStream.write(imageBytes);
            } catch (IOException e) {
                e.printStackTrace();
            }
            //leer la imagen base64 guardada
            BufferedImage imagen = ImageIO.read(new File("C:\\grupogd\\test_image.png"));
        /* guardar el base64*/
        /*nueva imagen redimencionada x,y,w,h*/
            ImageHelper imghelp = new ImageHelper();
            BufferedImage imagen2 = imghelp.getSubImage(imagen, 801, 774, 905, 73);

            try {
                ImageIO.write(imagen2, "png", new File("c:\\grupogd\\foto.png"));
             } catch (IOException e) {
                System.out.println("Error de escritura");
             }
            String path2 = "C:\\grupogd\\foto.png";
            File file2 = new File(path2);
        /*nueva imagen redimencionada*/
        
        try {
            
            String result = instance.doOCR(file2);
            System.out.println("Funciono");
            System.out.println(result);
        } catch (TesseractException e) {
            System.err.println(e.getMessage());
        }
    }
}
